  return (
    <div>
      <div className="sender">
        <img src={logo} className="logo" />
        <p>{d.lessor.address}</p>
        <p>{d.lessor.unitNumber}</p><p>{d.lessor.postalCode}</p>
      </div>


    </div>
  );
}

export default App;
